fieldValues.fieldValue:
={{
  {
    "status_wpp": $('Msg de inscrição confirmada').item.json.error || $('Enviar Imagem [Evolution]6').item.json.error ? false : true,
    "status_email": $json.response?.includes('250') ? true : false,
    "created_at": $now.toISO()
  }
}}

values.value:
={{
  (() => {
    if ($('Msg de inscrição confirmada').item.json.error || $('Enviar Imagem [Evolution]6').item.json.error) {
      return '❌ Erro na inscrição ou imagem';
    }

    if ($('Send email').item.json.response?.includes('250')) {
      return '✅ Disparo completo';
    }

    return '❌ Erro ao enviar o e-mail';
  })()
}}
